import styled from 'styled-components/native';

export const Background = styled.View`
    flex: 1;
    background-image: linear-gradient(155deg, #FFAB09 0%, #FFD024 0.01%, #B312B3 100%);


    display: flex;
    flex-flow: row nowrap;
    justify-content: center;
    align-items: center;



`;
